import React from "react";

export class Status extends React.Component {
  state = {
    editMode: false,
  };

  render() {
    return (
      <>
        <div>
          <p>{this.props.status}</p>
        </div>
        <div>
          <input autoFocus={true} value={this.props.status} />
        </div>
      </>
    );
  }
}
